import { HTMLAttributes } from "react";
export interface ISelectorGroup extends HTMLAttributes<HTMLDivElement> {
    /** Representing the name or label for the group */
    groupName: string;
    /** Child elements is `SelectorItem` component */
    children: JSX.Element | JSX.Element[];
    /** Maximum height of the item list */
    maxHeight?: string;
    /** Additional CSS classes to apply custom styling */
    className?: string;
    /** Disabled group button click */
    disabled?: boolean;
}
